def relu(x):
	if x > 0:
		return x
	else:
		return 0


def deriv(x):
	if x > 0:
		return 1
	else:
		return 0


def derivativeBias(x, y, z, g, h):
	dc = z - h
	da = deriv(np.dot(x, y) + g)
	db = dc * da
	return db


def derivativeWeights(x, y, z, g, h):
	dc = z - h
	da = deriv(np.dot(x, y) + g)
	dz = x
	dw = dz * dc * da
	return dw


def back(x, y, weights, bias):
	LR = .0000000009
	actual = relu(np.dot(x, weights) + bias)
	bias -= derivativeBias(x, weights, actual, bias, y)
	weights -= np.reshape(derivativeWeights(x, weights, actual, bias, y),(287, 1)) * LR

